package com.scaler.string;

public class CountOccurrencesRabin {
	
	public static int countOccurrences(String A, String B) {
		int n = A.length();
	    int m = B != null ? B.length() : 0;
	    System.out.println(m);
        if(  m == 0 ) return n+1;
	    int d = 31; // size of the alphabet
	    int q = 100000007; // a prime number

	    // calculate the hash value of B
	    int hB = 0;
	    for (int i = 0; i < m; i++) {
	        hB = (hB * d + B.charAt(i)) % q;
	    }

	    // calculate the hash value of the first substring of A of length M
	    int hA = 0;
	    for (int i = 0; i < m; i++) {
	        hA = (hA * d + A.charAt(i)) % q;
	    }

	    // iterate over all substrings of A of length M
	    int count = 0;
	    for (int i = 0; i <= n - m; i++) {
	        if (hA == hB) {
	            // compare the substring with B to confirm the match
	            int j;
	            for (j = 0; j < m; j++) {
	                if (A.charAt(i + j) != B.charAt(j)) {
	                    break;
	                }
	            }
	            if (j == m) {
	                count++; // match found
	            }
	        }

	        // update the hash value of the current substring of A
	        if (i < n - m) {
	            hA = (d * (hA - A.charAt(i) * pow(d, m-1, q)) + A.charAt(i+m)) % q;
	            if (hA < 0) {
	                hA += q;
	            }
	        }
	    }

	    return count;
	}

	// helper function to calculate x^y modulo q
	public static int pow(int x, int y, int q) {
	    if (y == 0) {
	        return 1;
	    }
	    int z = pow(x, y/2, q);
	    if (y % 2 == 0) {
	        return (z * z) % q;
	    } else {
	        return (x * z * z) % q;
	    }
	}
	public static void main(String[] args) {
		String a = "";
				
		String b = null;
		System.out.println(countOccurrences(a, b));
	}

}
